// PreviewPage.js
import React from "react";

export default function PreviewPage({ data }) {
  if (!data) return null;

  return (
    <div
      className="w-[794px] h-[1123px] bg-white p-10 mx-auto shadow-lg"
      style={{ fontFamily: "Arial" }}
    >
      {/* NAME + ROLE CENTER */}
      <h1 className="text-3xl font-bold text-center">{data.name}</h1>
      <p className="text-lg text-center mb-4">{data.role}</p>

      {/* CONTACT */}
      <p className="text-center">
        {data.email} | {data.phone}
      </p>

      <hr className="my-3" />

      {/* SUMMARY */}
      <h2 className="section-heading">Summary</h2>
      <hr />
      <p className="mt-1">{data.summary}</p>

      {/* ---------------- EDUCATION ---------------- */}
      <h2 className="section-heading mt-5">Education</h2>
      <hr />
      {data.education.map((edu, i) => (
        <div key={i} className="mt-2">
          <div className="flex justify-between">
            <p className="font-semibold">{edu.institute + ", " + edu.city}</p>
            <p>
              {edu.startYear} - {edu.endYear}
            </p>
          </div>

          <p className="mt-1">
            {edu.educationType} â€“ {edu.department} | {edu.score}
          </p>
        </div>
      ))}

      {/* ---------------- EXPERIENCE ---------------- */}
      <h2 className="section-heading mt-5">Experience</h2>
      <hr />
      {data.experience.map((ex, i) => (
        <div key={i} className="mt-2">
          <div className="flex justify-between">
            <p className="font-semibold">{ex.role}</p>
            <p>({ex.years})</p>
          </div>
          <p className="font-semibold mt-1">{ex.company}</p>
          <p className="mt-1 text-left">{ex.description}</p>
        </div>
      ))}

      {/* ---------------- PROJECTS ---------------- */}
      <h2 className="section-heading mt-5">Projects</h2>
      <hr />
      {data.projects.map((p, i) => (
        <div key={i} className="mt-2">
          <div className="flex justify-between">
            <p className="font-semibold">{p.title}</p>
            <a href={p.link} target="_blank" rel="noreferrer" className="text-blue-600 underline">
              {p.link}
            </a>
          </div>

          <p className="mt-1 text-left">{p.description}</p>

          <ul className="list-disc ml-5">
            {p.points.split(",").map((pt, idx) => (
              <li key={idx}>{pt.trim()}</li>
            ))}
          </ul>

          <p className="mt-1 text-sm">Tech Used: {p.tech}</p>
        </div>
      ))}

      {/* ---------------- CERTIFICATES ---------------- */}
      <h2 className="section-heading mt-5">Certificates</h2>
      <hr />
      {data.certificates.map((c, i) => (
        <div key={i} className="mt-2">
          <p className="font-semibold">{c.title}</p>
          <p className="text-left">
            Issued By: {c.issuedBy} ({c.year})
          </p>
        </div>
      ))}
    </div>
  );
}
